//Importaciones de  componentes propios
import { InventarioComponent } from './inventario.component';
import { ModalInventarioComponent } from './modal-inventario/modal-inventario.component';




@NgModule({
  declarations: [
    InventarioComponent,
    ModalInventarioComponent,

  ],
  imports: [
    CommonModule,
